window.bookSummaryJSON = "<p><b><i>The all-knowing semelees swirled around me in the Veiled Between, crooning and writhing. “You’ve come to us, Daughter of Darkness, Princess of Shadows. Tell us what you seek.”</i></b></p> <p>On the Silten continent, I’m the only fae who can walk the Veiled Between. My rare power is immense and dangerous, so the authorities have entrusted me to my guardian who controls my potent magic with an enchanted device.</p> <p>To avoid the device’s searing punishment, I submit to a dutiful life. Until one terrifying night everything changes.</p> <p>I’m taken captive by the ruthless Dark Raider—an outlaw wanted in all four kingdoms, who hides behind a mask, and has a body created for sin.</p> <p>But the Raider whispers a promise I can’t resist—use my magic to find who he seeks, and he’ll obliterate my chains.</p> <p>Finally, the freedom I’ve craved is within my reach.</p> <p>Yet finding who he hunts plunges me into a game of deceit among the kingdoms. After uncovering truths I was never meant to know, I’m caught in a web of betrayal, and if I can’t find a way to break free, I’ll have simply traded one imprisonment for another.</p> <p><i>Kingdom of Faewood</i> is book one in <i>Fae of Woodlands &amp; Wild</i>, a fae fantasy romance trilogy that takes place in Krista Street’s <i>Supernatural World</i>. This series contains spicy romance, epic worldbuilding, a female fae who’s determined to wield her own fate, a ruthless Dark Raider who will stop at nothing to protect those he loves, and a mysterious ploy circulating throughout the kingdoms.</p>"; 
